import React, {Component} from 'react';

import	"./Task.css";

class Task extends Component {
    render() {
        const {task} = this.props;
        const redColor = {background: 'red'};
        return <div style={redColor}>
            {task.title} - 
            {task.description} - 
            {task.done} - 
            {task.id}
            <input type="checkbox"/>
            <button>
                x
            </button>
        </div>
    }
}

export default Task;
